after restore from other cluster, then rowsets got different index_id, and make index compaction in base compaction always failed.

**Close this pr:**
because of duplicate pr, https://github.com/apache/doris/pull/41625 already fix itï¼š
```
            // no inverted index or index id is different from current index id
            if (tablet_index == nullptr || tablet_index->index_id() != index.index_id()) {
                is_continue = true;
                break;
            }

```

## Proposed changes

```
    void resize_fill(size_t n, const T& value) {
        size_t old_size = this->size();
        if (n > old_size) {
            this->reserve(n);
            std::fill(t_end(), t_end() + n - old_size, value);
        }
        this->c_end = this->c_start + this->byte_size(n);
    }
```
if n is not greater than old_size,
it's will not fill the data with value.

so it's not set the null_map flag to 1, it's can't return NULL
